double newton_raphson(double (*f)(const double, const double, const double,
    const double, const double, const double, const double, const double, const double),
    double guess,
    const unsigned int numIterations, const double r,
    const double mass,
    const double energy, const double bias,
    const double workFunction, const double k1, const double k3, const double gamma)
{
    static constexpr double precision{ 1e-20 };
    static constexpr double dx{ 1e-20 };
    double f0{};

    double prev_guess{ guess };

    if (r == 0)
    {
        return 6e-10;
    }

    for (int i{ 0 }; i < numIterations; ++i)
    {

        prev_guess = guess;
        f0 = f(guess, r, mass, energy, bias, workFunction, k1, k3, gamma);


        guess = guess - dx * f0
            / (f(guess + dx, r, mass, energy, bias, workFunction, k1, k3, gamma) - f0);

        if (guess < 1e-10)
        {
            guess = 1e-10;
        }
        else if (guess > 1e-9)
        {
            guess = 1e-9;
        }
        else if (abs(guess - prev_guess) < precision)
        {
            break;
        }

    }

    return guess;
}

